import "./App.css";
import Footer from "./components/Footer";
import Header from "./components/Header";
import SideBar from "./components/SideBar";
import Terms_Of_User from "./components/Terms_Of_User";
import Video_Call from "./components/Video_Call";
import Wallet from "./components/Wallet";
import Your_Carts from "./components/Your_Carts";
import toggle from "../src/images/F-logo.png";
import { useState } from "react";

function App() {

  const [hide,setHide]=useState(false);

  const hideShow=()=>{
    setHide(true)
  }

  return (
    <div>
      <div className="A">
      <button onClick={hideShow} id="toggle">
            <img src={toggle}></img>
          </button><br/>
        <div className="A-1">
        {hide ?  <SideBar />:null}
        <SideBar />
        </div>&nbsp;&nbsp;
        <div className="A-2">
         <Header />
         <hr id="hr3" />
         {/* <Terms_Of_User /> */}
         {/* <Your_Carts /> */}
         {/* <Video_Call /> */}
         <Wallet />
        </div> 
      </div>
      <hr id="hr" />
      <div className="A-3">
      <Footer  />
      </div>

    </div>
  );
}

export default App;
